import React, {useState, useEffect} from "react";
import axios from "axios";

const Ville = () => {
    const [ville, setville] = useState([]);
    let token = 'Bearer 1|XXfI3BOr01VoBYgF8nC27oD7KEN1Oh3EULg68Q4a';
    useEffect(() => {
        axios.get(`http://localhost:5000/api/ville`,
            {
                headers : {
                    Accept: 'application/json',
                    'Content-Type' : 'application/json',
                    Authorization : token
                }
            }
        ).then((response) => {
            setville(response.data.data);
        }).catch((error) => {
            alert(error)
        })
    }, [])
    return (
        <div className="card">
                <div className="card-body">
                  <h5 className="card-title"> <a href="" data-bs-toggle="modal" data-bs-target="#addadmin" className="btn btn-primary"> + Site</a></h5>
                  <div className="table-responsive">
                    <table
                      id="zero_config"
                      className="table table-striped table-bordered"
                    >
                      <thead>
                        <tr>
                          <th>Ville</th>
                          <th>Province</th>
                          <th>Action</th>
                        </tr>
                      </thead>
                      <tbody>
                            {
                                ville.map((e) => {
                                    return(
                                        <tr>
                                            <td>{e.nom_site}</td>
                                            <td>{e.ref_prov}</td>
                                            <td>
                                                <button className="btn btn-primary"><i className="fa fa-edit"></i></button> &nbsp;
                                                <button className="btn btn-primary"><i className="fa fa-edit"></i></button>
                                            </td>
                                        </tr>
                                    )
                                })
                            }
                    </tbody>
                    </table>
                  </div>
                </div>
              </div>
    )
}

export default Ville;
